import React from "react";
import "./compose.scss";

export default function Compose(props) {
  return (
    <div className="compose">
      <input
        type="text"
        className="compose-input"
        placeholder="Type a message, @name"
      />
      <input type="submit" value="Send" />
    </div>
  );
}
